import React, { Component } from 'react';



class Footer extends Component {
  render() {
    return (
      <footer>
        {/* this is footer code */}

<blockquote class="blockquote text-center my-5">
  <p class="mb-0">Pure Water Supply</p>
  <footer class="blockquote-footer">Pure Water Supply Company PL. All Rights Reserved. Pure Water, EARTH'S FINEST WATER, UNTOUCHED BY MAN, NATURE OF WATER, THE TASTE OF PARADISE, Trade Dress and accompanying logos are trademarks of Pure Water Company PL or its affiliates. <cite title="Source Title">2019</cite></footer>
</blockquote>
        
     </footer>
    );
  }
}

export default Footer;
